import Card from './card'
import ButtonAdd from './elements/buttonAdd'
import TextBox from './elements/textBox'
export default function CardList(props) {
  this.state = {
    cards: []
  }
  return (
    <div>
      <p>{props.title}</p>
      {
        this.states.cards.map((card) => {
          <Card content={card}/>
        })
      }
      <ButtonAdd/>
      <TextBox/>
    </div>
  )
}
